import React from "react";
import "./CampaignCard.css";
function CampaignCards() {
  return (
    <div className="outer">
    <div className="whole">
      <div className="card">
        <div className="name-of-ngo">
          <h1>NAME</h1>
        </div>
        <div className="mission">
          <h1>MISSION</h1>
        </div>
        <div className="target">
          <h1>TARGET FUND</h1>
        </div>
        <div className="container">
          <button className="fund-btn center">FUND CAMPAIGN</button>
        </div>
      </div>
    </div>
    </div>
  );
}
export default CampaignCards;
